  03> HANNA, Rodney Jack m on 01.05.1993 to COTTER, Justine Mary
  b 06.11.1964
  b 09.04.1966
  Rodney b. at Whangarei and m. at Milford. Justine, d/o Des and Pam Cotter, b. at Matamata.
  Address: 22 Karetu Road, Epsom, Auckland.
  Rodney was educated at Maungatapere Primary School and King's College where he was head prefect of
  Parnell House. He gained a Bachelor of Business Management from the University of Waikato and is
  now National Category Director for Lion Breweries. Justine also has a BMS and is a Senior Product
  Manager with Griffins. Their interests include travel, sport and redecorating houses.
  04> LUDBROOK, Elisabeth Hana m on 31.03.1963 to WILSON, Campbell Munro
  b 25.08.1936
  b 23.05.1939
  Elisabeth b. at Tupe Tupe, Ohaeawai. Address: 11 Victoria Street, Paihia, Bay of
  Islands.
  Elisabeth was educated at Whangarei Girls' High School and Northland College where she
  was twice senior athletics champion. She and Campbell farmed at Maungaturoto until their
  marriage was dissolved in 1974. Elisabeth then worked in Sydney and Auckland raising
  their children. She is now a popular artist in portraiture. She also works as a tutor
  with both children and adults.
  01> WILSON, Anna Munro Ludbrook
  b 17.10.1964
  Anna b. at Paparoa, Northland. Address: 11 Veronica Street, Paihia.
  Anna was educated at Maungaturoto, Opua and Sydney and studied fashion and design.
  She lived in Sydney and Perth and now owns and operates a restaurant in Kerikeri in
  partnership with her sister Laura.
  02> WILSON, Laura Munro Ludbook
  b 30.01.1966
  Laura b. at Paparoa, Northalnd. Address: 11 Veronica Street, Paihia.
  Laura was educated Maungaturoto, Opua, Sydney and Auckland. She qualified as a
  Rudolf Steiner teacher and has a geology degree from the University of Canterbury.
  She is now in partnership with her sister Anna in a restaurant in Kerikeri.
  03> WILSON, Andrew Munro Ludbrook
  b 09.10.1967
  Andrew b. at Paparoa, Northland. Address: 11 Veronica Street, Paihia.
  Andrew was educated at Opua, Sydney and Auckland Boys' Grammar School. He qualified
  in design engineering and presently works for a firm in Auckland. He captained his
  Otago University sail board team and now enjoys yacht racing on the Waitemata
  Harbour.
